import { Chart } from "react-google-charts";
import React, { useEffect, useState } from 'react';


const PieChartReportsTypeOfRegion = () => {

    const [reportsType,setReportsType] = useState([]);


    useEffect(()=>{

    },[])

    const data = [['Task', 'Hours per Day'], ['dio can', 10], ['merda la madonna', 3]]
    return (
        <div className="pie-chart">
            <Chart
                width={'100%'}
                height={'400px'}
                chartType="PieChart"
                loader={<div>Loading Chart</div>}
                data={
                    data
                }
                options={{
                    alignment: "center",
                    legend: {
                        position: 'left',
                        alignment: 'center',
                        orientation: 'vertical',
                    },
                    chartArea: {
                        left: 0,
                        top: 0,
                        width: "100%",
                        height: "80%"
                    },
                    // Just add this option
                    pieHole: 0.7,
                    backgroundColor: 'transparent',
                    colors: ['#40ff00', '#ff0000', '#ffffff', '#FFA500', '#DFFF00', '#6495ED']
                }}

                rootProps={{ 'data-testid': '3' }}
            />
        </div>
    );
};

export default PieChartReportsTypeOfRegion;
